    return (
      <>
        <Header />
        <ToolBar title={'Item List'} />
        <div
          id='kt_content_container'
          class='d-flex flex-column-fluid align-items-start container-xxl '
        >
          {/*begin::Post*/}
        </div>

        <Footer />
      </>
    )
  }
}

export default itemList
